This sample shows how to call CreateOrUpdateAsync and parse the result.

AzureKeyCredential credential = new AzureKeyCredential("<key>");
Cars client = new ServiceClient(credential).GetCarsClient(apiVersion: "2022-11-01-preview");

using RequestContent content = RequestContent.Create(new
{
    vehicleKind = "Car",
    numberOfDoors = 123,
});
Response response = await client.CreateOrUpdateAsync("<workspaceName>", "<carId>", content);

JsonElement result = JsonDocument.Parse(response.ContentStream).RootElement;
Console.WriteLine(result.GetProperty("id").ToString());
Console.WriteLine(result.GetProperty("vehicleKind").ToString());
Console.WriteLine(result.GetProperty("numberOfDoors").ToString());

